import { useState } from 'react'

const Display = (props) => {
  return (
    <div>{props.good_counter}</div>
  )
}

const Button = (props) => {
  return (
    <button onClick={props.handleClick}>
      {props.text}
    </button>
  )
}

const App = () => {
  const [good_counter, setGood] = useState(0)
  const [bad, setBad] = useState(0)

  const increaseByOne = () => {
    setGood(good_counter + 1)
    setBad(good_counter + 1)
  }

  return (
    <div>
      <Display good_counter={good_counter} />
      <Button handleClick={increaseByOne} text="good" />
      <Button handleClick={increaseByOne} text="neutral" />
      <Button handleClick={increaseByOne} text="bad" />
    </div>
  )
}

export default App
